type testCase struct {
	perm []int
}

func expected(perm []int) int {
	res := 0
	for i := 0; i < len(perm)-1; i++ {
		if perm[i] > perm[i+1] {
			res++
			i++
		}
	}
	return res
}

func parseTestcases() ([]testCase, error) {
	fields := strings.Fields(strings.TrimSpace(testcasesRaw))
	if len(fields) == 0 {
		return nil, fmt.Errorf("no testcases")
	}
	idx := 0
	t, err := strconv.Atoi(fields[idx])
	if err != nil {
		return nil, fmt.Errorf("parse t: %v", err)
	}
	idx++
	cases := make([]testCase, 0, t)
	for caseNum := 1; caseNum <= t; caseNum++ {
		if idx >= len(fields) {
			return nil, fmt.Errorf("case %d: missing n", caseNum)
		}
		n, err := strconv.Atoi(fields[idx])
		if err != nil {
			return nil, fmt.Errorf("case %d: parse n: %v", caseNum, err)
		}
		idx++
		if idx+n > len(fields) {
			return nil, fmt.Errorf("case %d: not enough elements", caseNum)
		}
		perm := make([]int, n)
		for i := 0; i < n; i++ {
			v, err := strconv.Atoi(fields[idx+i])
			if err != nil {
				return nil, fmt.Errorf("case %d: parse perm[%d]: %v", caseNum, i, err)
			}
			perm[i] = v
		}
		idx += n
		cases = append(cases, testCase{perm: perm})
	}
	if idx != len(fields) {
		return nil, fmt.Errorf("extra data after parsing: %d fields remain", len(fields)-idx)
	}
	return cases, nil
}

func buildIfGo(path string) (string, func(), error) {
	if strings.HasSuffix(path, ".go") {
		tmp, err := os.CreateTemp("", "solbin*")
		if err != nil {
			return "", nil, err
		}
		tmp.Close()
		out, err := exec.Command("go", "build", "-o", tmp.Name(), path).CombinedOutput()
		if err != nil {
			os.Remove(tmp.Name())
			return "", nil, fmt.Errorf("build failed: %v\n%s", err, out)
		}
		return tmp.Name(), func() { os.Remove(tmp.Name()) }, nil
	}
	return path, func() {}, nil
}

func runCandidate(bin, input string) (string, error) {
	cmd := exec.Command(bin)
	cmd.Stdin = strings.NewReader(input)
	var out bytes.Buffer
	cmd.Stdout = &out
	cmd.Stderr = &out
	if err := cmd.Run(); err != nil {
		return "", fmt.Errorf("runtime error: %v\n%s", err, out.String())
	}
	return strings.TrimSpace(out.String()), nil
}

func main() {
	if len(os.Args) != 2 {
		fmt.Fprintln(os.Stderr, "usage: go run verifierB.go /path/to/binary")
		os.Exit(1)
	}

	cases, err := parseTestcases()
	if err != nil {
		fmt.Fprintln(os.Stderr, err)
		os.Exit(1)
	}

	bin, cleanup, err := buildIfGo(os.Args[1])
	if err != nil {
		fmt.Fprintln(os.Stderr, err)
		os.Exit(1)
	}
	defer cleanup()

	for i, tc := range cases {
		input := fmt.Sprintf("1\n%d\n", len(tc.perm))
		for j, v := range tc.perm {
			if j > 0 {
				input += " "
			}
			input += fmt.Sprintf("%d", v)
		}
		input += "\n"

		want := fmt.Sprintf("%d", expected(tc.perm))
		got, err := runCandidate(bin, input)
		if err != nil {
			fmt.Printf("case %d: %v\n", i+1, err)
			os.Exit(1)
		}
		if strings.TrimSpace(got) != want {
			fmt.Printf("case %d failed\ninput:\n%sexpected: %s\ngot: %s\n", i+1, input, want, got)
			os.Exit(1)
		}
	}

	fmt.Printf("All %d tests passed\n", len(cases))
}
